import React from "react";
import Navbar from "./components/Navbar.js";
import Home from "./pages/Home.js";
import About from "./pages/Directors.js";
import Pricing from "./pages/Profile.js";
import { Route, Routes } from "react-router-dom";
import "./App.css";

function App() {
  return (
    <>
      <Navbar />
      <div className="container">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/profile" element={<Pricing />} />
          <Route path="/directors" element={<About />} />
        </Routes>
      </div>
    </>
  )
}

export default App;
